import logo from './logo.svg';
import React from 'react';
import { BrowserRouter as Router, Link, Route } from 'react-router-dom';
import './App.css';

// Create a separate component for the second page
const SecondPage = () => (
  <div className="App">
    <header className="App-header">
      <p>
        This is the second page. You can add more content here.
      </p>
      <Link to="/">Go back to the main page</Link>
    </header>
  </div>
);

function App() {
  return (
    <Router>
      <div>
        <Route path="/" exact>
          <div className="App">
            <header className="App-header">
              {/* Your existing content */}
              <img src={logo} className="App-logo" alt="logo" />
              <p>
                Edit <code>src/App.js</code> and save to reload.
              </p>
              <div>
                <h1>Welcome</h1>
                {/* Button to navigate to the second page */}
                <Link to="/second-page">
                  <button>Start</button>
                </Link>
              </div>
              <a
                className="App-link"
                href="https://reactjs.org"
                target="_blank"
                rel="noopener noreferrer"
              >
                Learn React
              </a>
            </header>
          </div>
        </Route>

        {/* Route for the second page */}
        <Route path="/second-page" exact component={SecondPage} />
      </div>
    </Router>
  );
}

export default App;
